import axios from "axios";
import "./userList.css";
import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import react, { useEffect, useState } from "react";
import { Button, ButtonBase, FormLabel, TextField } from "@material-ui/core";
import { Link } from "react-router-dom/cjs/react-router-dom.min";

export default function UserList() {
  const [users, setUsers] = useState([]);
  const [search, setSearch] = useState("");
  useEffect(() => {
    loadProduct();
  }, []);

  const loadProduct = async () => {
    await axios.get("http://localhost:3003/user").then((res) => {
      setUsers(res.data);
    });
  };
  const useStyles = makeStyles({
    btn: {
      backgroundColor: "rgb(228, 228, 250)",
      float: "center",
      margincenter: 50,
    },
    table: {
      minWidth: 650
    }
  });
  const classes = useStyles();
  const DeleteProduct = async (id) => {
    await axios.delete(`http://localhost:3003/user/${id}`);
    loadProduct();
  };
  return (
    <div className="userList">
      <div className="App">
        <Link to="/newUser">
          {" "}
          <Button variant="outlined">Add user</Button>
        </Link>
        <input
          onChange={(e) => setSearch(e.target.value)}
          type="search"
          placeholder="serach.."
          className="search"
        />
        <br />
        <br />
        <br />
        <Paper>

        <TableContainer>
          <Table className={classes.table} aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell>UserName</TableCell>
                <TableCell align="right">Name</TableCell>
                <TableCell align="right">Phone&nbsp;(g)</TableCell>
                <TableCell align="right">Address&nbsp;(g)</TableCell>
                <TableCell align="right">Role&nbsp;(g)</TableCell>
                <TableCell align="right">Email&nbsp;(g)</TableCell>
                <TableCell align="right">Action&nbsp;(g)</TableCell>

              </TableRow>
            </TableHead>
            <TableBody>
              {users.map((row) => (
                <TableRow key={row.id}>
                  <TableCell component="th" scope="row">
                    {row.UserName}
                  </TableCell>
                  <TableCell align="right">{row.FullName}</TableCell>
                  <TableCell align="right">{row.phone}</TableCell>
                  <TableCell align="right">{row.address}</TableCell>
                  <TableCell align="right">{row.role}</TableCell>
                  <TableCell align="right">{row.email}</TableCell>
                  <TableCell align="right">Actions</TableCell>

                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Paper>

    </div>       
    </div>
  );
}
